function Levels(state){
    this.levels = [];
    this.newLevelCounter = 0;
    this.state =  state;
    this.type = 0;
    this.levelsSpawned = 0;
    this.inBossFight = false;
    this.inChallengeRoom = false;
    this.challengeRoomStarted = false;

    
    this.update = function () {
        if(GAMESTARTED) {
            if(this.inChallengeRoom){
                if(this.newLevelCounter < 0){
                    switch (this.type){
                        case 1:
                            this.levels.push(new Level(2560, "challenge room 1", this.state));
                            break;
                        case 2:
                            this.levels.push(new Level(2560, "challenge room 2", this.state));
                            break;
                        case 3:
                            this.levels.push(new Level(2560, "challenge room 3", this.state));
                            break;
                        case 4:
                            this.levels.push(new Level(2560, "challenge room 4", this.state));
                            break;
                    }

                    this.newLevelCounter = 2570;
                }

            }else {
                if (this.newLevelCounter < 0) {
                    if (this.levelsSpawned < 10) {
                        this.levels.push(new Level(2560, this.type, this.state));
                        this.newLevelCounter = 2570;
                        this.levelsSpawned++;
                    } else {
                        if (!this.inBossFight) {
                            this.levels.push(new Level(2560, ((this.type * 2) + getRandomInt(1, 2)) * -1, this.state));

                            this.newLevelCounter = 2570;
                            this.inBossFight = true;
                        }
                    }
                }
            }
            this.newLevelCounter -= GAMESPEED * 10;
            }

            for (var i = 0; i < this.levels.length; i++) {
                this.levels[i].update();
            }

    }
    
    
    this.show = function () {
        for(var i = 0; i < this.levels.length; i++){
            this.levels[i].show();
        }
    }


}





